import Button from "./components/Button/Button";
import React from "react";
import Text from "./components/Text/Text.jsx";


const name = 'Change';
const title = "Functional component";
const titleClass = "Class component";
let flag = 0;

function App() {
    return (
        <div className="App-header">
            {!flag && <Func_example title = {title}/>}
            {flag && <Class_example title = {titleClass}/>}
            <Button/>
            <Text name={name}/>
        </div>

    )
        ;
}

export default App;
